import React, { Component } from 'react'
import axios from "axios"
import logo from './Zed.jpg';
export class home extends Component {

    state = {
        users: [
        ],
        champions: [
        ],
        maxmastery: [
        ],
        championList:[
        ],
        lista:[],
        Campeon:[],
        imagen:""
    }

    async componentDidMount() {

        const res = await axios("http://localhost:4000/perfil/abidin")
        const champs = await axios("http://ddragon.leagueoflegends.com/cdn/10.7.1/data/en_US/champion.json")
        const champmasterymax = await axios("http://localhost:4000/perfil/maxmastery/BQ7Qb6NXpsC0ZoyHJMojUOb1oFcRS9rpeBtYXpmLG327K2U")
        this.setState({ users: res.data })
        this.setState({champions: champs.data})
        this.setState({maxmastery: champmasterymax.data[0].championId})
        this.setState({championList: this.state.champions.data})
        const url = 'http://ddragon.leagueoflegends.com/cdn/10.7.1/data/en_US/champion.json'

      let dataSource = [];

      Object.values(champs.data.data).forEach(item => {
          dataSource = dataSource.concat(item);
      });

      this.setState({lista: dataSource})
      console.log(this.state.lista.length)
      console.log(this.state.maxmastery)
      this.state.lista.forEach((item, i) => {
        if (item.key == this.state.maxmastery) {
          return this.setState({ Campeon: item.id });
        }
      })
    }


    render() {
        return (
            <div>
                <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
                    <h5 className="my-0 mr-md-auto font-weight-normal">Perfil</h5>
                    <nav className="my-2 my-md-0 mr-md-3">
                        <a className="p-2 text-dark" href="#">Features</a>
                        <a className="p-2 text-dark" href="#">Enterprise</a>
                        <a className="p-2 text-dark" href="#">Support</a>
                        <a className="p-2 text-dark" href="#">Pricing</a>
                    </nav>
                    <a className="btn btn-outline-primary" href="#">Iniciar Sesión</a>
                </div>
                <div className="container">
                    <div className="card mb-3">
                    { this.state.Campeon}

                        <img src={require('./dragontail-10.7.1/img/champion/splash/Yasuo_1.jpg')} className="card-img-top"/>
                            <div className="card-body">
                                <h5 className="card-title">{this.state.users.name}</h5>
                                <p className="card-text">Nivel {this.state.users.summonerLevel}</p>
                                <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
                            </div>
                    </div>

                        <footer className="pt-4 my-md-5 pt-md-5 border-top">
                            <div className="row">
                                <div className="col-12 col-md">
                                    <small className="d-block mb-3 text-muted">© 2017-2019</small>
                                </div>
                                <div className="col-6 col-md">
                                    <h5>Features</h5>
                                    <ul className="list-unstyled text-small">
                                        <li><a className="text-muted" href="#">Cool stuff</a></li>
                                    </ul>
                                </div>
                                <div className="col-6 col-md">
                                    <h5>Resources</h5>
                                    <ul className="list-unstyled text-small">
                                        <li><a className="text-muted" href="#">Resource</a></li>
                                    </ul>
                                </div>
                                <div className="col-6 col-md">
                                    <h5>About</h5>
                                    <ul className="list-unstyled text-small">
                                        <li><a className="text-muted" href="#">Team</a></li>
                                    </ul>
                                </div>
                            </div>
                        </footer>
                    </div>
                </div>
        )
    }
}

export default home
